import MenuItem from "./MenuItem"

const Menu = ({className, menuItems, onSectionScroll}) => {
  return (
    <ul data-name="menu" className={`${className}__menu`}>
      
      {menuItems.length && 
        menuItems.map(item => 
          <MenuItem 
            className={className} 
            item={item} 
            key={item.target}
            onSectionScroll={onSectionScroll}
          />
      )} 
    </ul>
  )
}

export default Menu
